*/

// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import MKTypography from "components/MKTypography";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import {
  Card,
  CardContent,
  Typography,
  CardHeader,
} from "@mui/material";
// Material Kit 2 React examples
// import DefaultCounterCard from "examples/Cards/CounterCards/DefaultCounterCard";
import {bgImage , macbook} from "assets/images/bg3.jpg"

// Images
// import coinbase from "assets/images/logos/gray-logos/logo-coinbase.svg";
// import nasa from "assets/images/logos/gray-logos/logo-nasa.svg";
// import netflix from "assets/images/logos/gray-logos/logo-netflix.svg";
// import pinterest from "assets/images/logos/gray-logos/logo-pinterest.svg";
// import spotify from "assets/images/logos/gray-logos/logo-spotify.svg";
// import vodafone from "assets/images/logos/gray-logos/logo-vodafone.svg";

function Featuring() {
  return (
    <MKBox component="section" pt={3} pb={8}>
        {" "}
        {/* <Grid container spacing={3} sx={{ mb: 12 }}>
                <Grid item xs={6} md={4} lg={2}>
                  <MKBox component="img" src={coinbase} alt="coinbase" width="100%" opacity={0.7} />
                </Grid>
                <Grid item xs={6} md={4} lg={2}>
                  <MKBox component="img" src={nasa} alt="nasa" width="100%" opacity={0.7} />
                </Grid>
                <Grid item xs={6} md={4} lg={2}>
                  <MKBox component="img" src={netflix} alt="netflix" width="100%" opacity={0.7} />
                </Grid>
                <Grid item xs={6} md={4} lg={2}>
                  <MKBox component="img" src={pinterest} alt="pinterest" width="100%" opacity={0.7} />
                </Grid>
                <Grid item xs={6} md={4} lg={2}>
                  <MKBox component="img" src={spotify} alt="spotify" width="100%" opacity={0.7} />
                </Grid>
                <Grid item xs={6} md={4} lg={2}>
                  <MKBox component="img" src={vodafone} alt="vodafone" width="100%" opacity={0.7} />
                </Grid>
              </Grid> */}{" "}
        <MKBox mt={7} >
          <MKBox
            variant="gradient"
            bgColor="info"
            position="relative"
            borderRadius="xl"
            sx={{
              overflow: "hidden",
            }}
          >
            <MKBox
              component="img"
              src={bgImage}
              alt="pattern-lines"
              sx={{        backgroundAttachment: "fixed", // Fondo estático
            }}
              position="absolute"
              top={0}
              left={0}
              width="100%"
              zIndex={1}
              opacity={0.5}
            />{" "}
            <Container
              sx={{
                position: "relative",
                zIndex: 2,
                pt: 12,
              }}
            >
              <Grid
                container
                item
                spacing={8}
                xs={12}
                md={12}
                fontWeight="bold"
                justifyContent="center"
                pb={8}
              >
                <Grid item xs={12} md={4}>  
                    <Card
                    >
                    <CardHeader
                      align="center"
                      title={
                        <Typography
                          variant="h2"
                          color="textInfo"
                          align="center"
                          component="p"
                        >
                          Misión
                        </Typography>
                      }
                    />{" "}
                    <CardContent>
                      <Typography
                        variant="h5"
                        color="textSecondary"
                        component="p"
                        my={2}
                        textAlign="justify"
                      >
                        Proporcionar un adecuado servicio de salud ocupacional a las empresas acorde a las normativas vigentes del sistema de salud en México.
                      </Typography>{" "}
                    </CardContent>{" "}
                  </Card>{" "}
                </Grid>{" "}
                <Grid item xs={12} md={4} my={12}>
                  <Card>
                  <CardHeader
                    align="center"
                    title={
                      <Typography
                        variant="h2"
                        color="textInfo"
                        align="center"
                        component="p"
                      >
                        Visión
                      </Typography>
                    }
                  />{" "}
                  <CardContent>
                    <Typography
                      variant="h5"
                      color="textSecondary"
                      component="p"
                      my={2}
                      textAlign="justify"
                    >
                      Ser una empresa líder en salud ocupacional a nivel estatal y federal con la mira a superar las barreras internacionales.
                    </Typography>{" "}
                  </CardContent>{" "}

                </Card>{" "}
                </Grid>{" "}
                <Grid item xs={12} md={4}>
                 <Card>
                  <CardHeader
                    align="center"
                    title={
                      <Typography
                        variant="h2"
                        color="textInfo"
                        align="center"
                        component="p"
                      >
                        Política de calidad
                      </Typography>
                    }
                  />{" "}
                  <CardContent>
                    <Typography
                      variant="h5"
                      color="textSecondary"
                      component="p"
                      my={2}
                      textAlign="justify"
                    >
                      Implementar servicios de Salud Laboral especializados que ayuden a organizaciones de todos los sectores a cumplir con las normativas de Salud Ocupacional.
                    </Typography>{" "}
                  </CardContent>{" "}
                </Card>{" "}
                </Grid>{" "}
              </Grid>{" "}
            </Container>{" "}
          </MKBox>{" "}
        </MKBox>{" "}
        <MKBox
      minHeight="25rem"
      opacity={0.8}
      width="100%"
      sx={{
        backgroundImage: `url(${bgImage})`,
        backgroundSize: "cover",
        backgroundPosition: "top",
        backgroundAttachment: "fixed", // Fondo estático
        display: "grid",
        placeItems: "center",
      }}
    >
      <Container>
      <Grid container>
  <Grid item md={12} xs={12}>
    <Card variant="outlined">
      <Grid container spacing={5} className="side-by-side-boxes" position="relative">
        <Grid item xs={12} md={7}>
          <MKBox>
            <MKTypography
              variant="h5"
              color="gray"
              p={5}
              sx={{
                lineHeight: 2,
                fontStyle: "oblique",
                textAlign: "justify",
              }}
            >
              <strong>
                Nuestra metodología se basa en tres pilares fundamentales:
              </strong>{" "}
              el trabajo en equipo, la mejora continua y la medición de servicios. Estos principios nos permiten colaborar eficazmente con tu organización para garantizar el cumplimiento de la normativa oficial mexicana en el ámbito de la salud ocupacional.
            </MKTypography>
          </MKBox>
        </Grid>
        <Grid item xs={12} md={5} container alignItems="center" justify="center">
          <MKBox>
            <MKBox
              component="img"
              src={macbook}
              alt="SMELS"
              width="95%"
            />
          </MKBox>
        </Grid>
      </Grid>
    </Card>
  </Grid>
</Grid>

      </Container>{" "}
    </MKBox>
    </MKBox>
  );
}

export default Featuring;
